import React, { useState } from "react";
import axios from "axios";

import Button from "react-bootstrap/Button";
import Modal from "react-bootstrap/Modal";
import Form from "react-bootstrap/Form";

function AddItemModal(props) {
  const addItem = ({
    tag_id,
    drop_off,
    due_date,
    description,
    color,
    transaction,
    is_shoe,
    follow_up,
    type,
  }) => {
    axios
      .post(`${props.WEMES_URL}items/`, {
        tag_id: tag_id,
        drop_off: drop_off,
        due_date: due_date,
        description: description,
        color: color,
        transaction: transaction,
        is_shoe: is_shoe,
        follow_up: follow_up,
        type: type,
      })
      .then((response) => {
        console.log(response);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  const [itemData, setItemData] = useState({
    tag_id: "",
    drop_off: "",
    due_date: "",
    description: "",
    color: "",
    transaction: "",
    is_shoe: "",
    follow_up: "",
    type: "",
  });

  const submitItemData = (event) => {
    event.preventDefault();
    addItem(itemData);
    setItemData({
      tag_id: "",
      drop_off: "",
      due_date: "",
      description: "",
      color: "",
      transaction: "",
      is_shoe: "",
      follow_up: "",
      type: "",
    });
  };

  return (
    <Modal
      {...props}
      size="lg"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header closeButton>
        <Modal.Title id="contained-modal-title-vcenter">
          Add New Item
        </Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <Form size="lg" onSubmit={submitItemData}>
          {/* TAG ID */}
          <Form.Group className="mb-3" controlId="formTagID">
            <Form.Label>Tag ID</Form.Label>
            <Form.Control
              type="text"
              placeholder="xxxx"
              onChange={(event) =>
                setItemData({
                  ...itemData,
                  tag_id: event.target.value,
                })
              }
            />
            <Form.Text className="text-muted"></Form.Text>
          </Form.Group>

          {/* DROP OFF DATE */}
          <Form.Group className="mb-3" controlId="formDropOff">
            <Form.Label>Drop Off Date</Form.Label>
            <Form.Control
              type="date"
              onChange={(event) =>
                setItemData({
                  ...itemData,
                  drop_off: event.target.value,
                })
              }
            />
            <Form.Text className="text-muted"></Form.Text>
          </Form.Group>

          <Form.Group className="mb-3" controlId="formDueDate">
            <Form.Label>Due Date</Form.Label>
            <Form.Control
              type="date"
              name="due_date"
              onChange={(event) =>
                setItemData({
                  ...itemData,
                  due_date: event.target.value,
                })
              }
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="formDescription">
            <Form.Label>Description</Form.Label>
            <Form.Control
              type="text"
              placeholder="Leave a Note"
              onChange={(event) =>
                setItemData({
                  ...itemData,
                  description: event.target.value,
                })
              }
            />
            <Form.Text className="text-muted"></Form.Text>
          </Form.Group>

          <Form.Group className="mb-3" controlId="formColor">
            <Form.Label>Color</Form.Label>
            <Form.Control
              type="text"
              placeholder="Color"
              onChange={(event) =>
                setItemData({
                  ...itemData,
                  color: event.target.value,
                })
              }
            />
            <Form.Text className="text-muted"></Form.Text>
          </Form.Group>

          <Form.Group className="mb-3" controlId="formTransaction">
            <Form.Label>Transaction</Form.Label>
            <Form.Control
              type="text"
              // placeholder="Color"
              onChange={(event) =>
                setItemData({
                  ...itemData,
                  transaction: event.target.value,
                })
              }
            />
            <Form.Text className="text-muted"></Form.Text>
          </Form.Group>

          <Form.Group className="mb-3" controlId="formDescription">
            <Form.Label>Is Shoe</Form.Label>
            <Form.Control
              type="checkbox"
              // placeholder="Color"
              onChange={(event) =>
                setItemData({
                  ...itemData,
                  is_shoe: event.target.value,
                })
              }
            />
            <Form.Text className="text-muted"></Form.Text>
          </Form.Group>

          <Form.Group className="mb-3" controlId="formDescription">
            <Form.Label>Needs Follow-Up</Form.Label>
            <Form.Control
              type="checkbox"
              // placeholder="Color"
              onChange={(event) =>
                setItemData({
                  ...itemData,
                  follow_up: event.target.value,
                })
              }
            />
            <Form.Text className="text-muted"></Form.Text>
          </Form.Group>

          <Form.Group className="mb-3" controlId="formDescription">
            <Form.Label>Type</Form.Label>
            <Form.Control
              placeholder="Leave a Note"
              onChange={(event) =>
                setItemData({
                  ...itemData,
                  type: event.target.value,
                })
              }
            />
            <Form.Text className="text-muted"></Form.Text>
          </Form.Group>

          {/* <Form.Group className="mb-3" controlId="formBasicCheckbox">
        <Form.Check type="checkbox" value="false" label="Check me out" />
      </Form.Group> */}

          <Button variant="warning" type="submit" onClick={props.onHide}>
            Submit
          </Button>
        </Form>
      </Modal.Body>
    </Modal>
  );
}

export default AddItemModal;
